uu8e2lUFZ";}i:176;a:1:{s:5:"image";s:249:"https://scontent-sin6-1.cdninstagram.com/v/t51.2885-15/e35/s1080x1080/118763774_626777944910857_1504092096406601412_n.jpg?_nc_ht=scontent-sin6-1.cdninstagram.com&_nc_cat=101&_nc_ohc=ubkT9fExmdwAX-osnDp&oh=f154cb19006357a9320bfb7c11a5e84f&oe=5F7CE28F";}i:177;a:1:{s:4:"type";s:5:"image";}i:178;a:1:{s:8:"owner_id";i:8432003942;}i:179;a:1:{s:14:"owner_username";s:0:"";}i:180;a:1:{s:14:"owner_fullname";s:0:"";}i:181;a:1:{s:9:"owner_pic";s:0:"";}i:182;a:1:{s:2:"id";s:19:"2391054536875167987";}i:183;a:1:{s:10:"short_code";s:11:"CEuu27VB9Dz";}i:184;a:1:{s:12:"created_time";i:1599255966;}i:185;a:1:{s:7:"caption";s:1206:"When my watch called me out last month saying I moved less this year compared to last year, I was ticked!  Then I got to thinking that I had not run in 15 months and that was something fun I liked doing with friends...the occasional 5k.  The excitement in the air when doing a run with a group toward a common goal is exhilarating. 

I'm not gonna allow Corona to take another thing away from me.  So I decided to grab a group of people that want to move more than they have been.  Some are walking, some are experienced runners and some are wanting to get back into running.  We are all at different levels and starting points but with one common goal...to move more!  It  has just been one week and it is so refreshing to see the positivity and support between once strangers in the group!  This group motivated me to get out there an run again and today is day 5 and I have run a total of 10 miles! That is HUGE for me! 

If you want to move your body more this month, join in on our Going the Distance group!  You set your own goal, you decide if you walk or run.  Just get moving!  In the future we will choose a date todo a virtual 5k where you can walk or run to the finish line! 
